import "./"

function QuestionAnswer(props) {
  console.log(props.faqTunnel.question);
  console.log(props.faqTunnel.answer);

  return (
    <div>
      <div className="faq-question-container">
        <div className="faq-question">{props.faqTunnel.question}</div>
      </div>
      <div className="faq-answer">{props.faqTunnel.answer}</div>
    </div>
  );
}

export default QuestionAnswer;
